('BD857722-21E0-4299-AD00-25A58EE7EF10','FFCF6DDF-9EA1-46FF-B9EF-C7660DAF0F40',2,'TolerancePercentage','Tolerance %','{"$type":"Vanrise.Analytic.Entities.AnalyticMeasureConfig, Vanrise.Analytic.Entities","GetValueMethod":"var calculatedRev = context.GetAggregateValue(\"CalculatedRevenue\");\nvar declaredRev = context.GetAggregateValue(\"DeclaredRevenue\");\nif (calculatedRev == null)\n calculatedRev = 0;\nif (declaredRev == null)\n declaredRev= 0;\n\nvar numerator = calculatedRev -declaredRev;\nvar denominator =calculatedRev ;\nif(denominator ==0)\ndenominator =declaredRev;\nif(denominator ==0)\ndenominator =1;\nreturn Math.Abs((numerator*100) /denominator);","DependentAggregateNames":{"$type":"System.Collections.Generic.List`1[[System.String, mscorlib]], mscorlib","$values":["CalculatedRevenue","DeclaredRevenue"]},"FieldType":{"$type":"Vanrise.GenericData.MainExtensions.DataRecordFields.FieldNumberType, Vanrise.GenericData.MainExtensions","ConfigId":"75aef329-27bd-4108-b617-f5cc05ff2aa3","ViewerEditor":"vr-genericdata-fieldtype-number-viewereditor","RuntimeEditor":"vr-genericdata-fieldtype-number-runtimeeditor","DataPrecision":0,"DataType":0,"IsNullable":false,"CanRoundValue":true,"DetailViewerEditor":"vr-genericdata-datarecordfield-defaultdetailviewer","OrderType":0,"StoreValueSerialized":false},"RequiredPermission":{"$type":"Vanrise.Security.Entities.RequiredPermissionSettings, Vanrise.Security.Entities","Entries":{"$type":"System.Collections.Generic.List`1[[Vanrise.Security.Entities.RequiredPermissionEntry, Vanrise.Security.Entities]], mscorlib","$values":[]}},"HideDescriptionInLegend":false,"MeasureUnit":0}'),
